import Header from '../Header/Header';

const Home = () => {
  return (
    <>
      <Header />
      <div className="home">
        <div className="firstdiv">
          <h3>Welcome to my website!</h3>
          <p>This is the content of the firstdiv.</p>
        </div>
      </div>
      {/* The rest of your app */}
    </>
  );
};

export default Home;
